const inputClick = console.log("clicked");
const mouseOver = console.log("over mouse");

const helpText = "help me";

function Header() {
  return <header>Cite header</header>;
}

function App() {
  return (
    <div className="name">
      <Header />
      <Header />
      <Header />
      <h1>{helpText}</h1>
      <input
        placeholder={helpText}
        onClick={inputClick}
        onMouseEnter={mouseOver}
      />
      <p>{helpText === "help me" ? "ok" : "no"}</p>
    </div>
  );
}

const app = ReactDOMClient.createRoot(document.getElementById("app"));

app.render(<App />);
